insert  into `t_application`(`id`,`name`,`email`,`age`,`idea`,`created_at`,`phone_no`) values 
(7,'Bishal','dhakalbishal930@gmail.com',20,'Our idea is to develop a mobile application that connects local farmers directly with consumers, promoting sustainable agriculture and supporting local economies. Through the app, users can browse and purchase fresh produce, dairy products, and other farm goods directly from nearby farmers, cutting out the middlemen and ensuring fair prices for both farmers and consumers. The app will provide detailed information about each farmer, including their farming practices, certifications, and product availability. Additionally, users will have access to educational content on sustainable farming and healthy eating. By fostering direct connections between farmers and consumers, our idea aims to enhance food transparency, reduce food waste, and create a stronger sense of community. We believe this innovative approach has the potential to revolutionize the way people access and consume locally produced food, promoting a more sustainable and equitable food system.','2023-06-19 11:15:01',17959259);
