insert  into `t_event_master`(`id`,`name`,`date`,`description`,`image`,`status`,`created_at`,`created_by`,`updated_at`,`updated_by`) values 
(17,'Startup Bootcamp','2023-06-23','A startup bootcamp is an intensive, structured program designed to support and accelerate the growth of early stage startups. It provides entrepreneurs with a comprehensive set of resources, mentorship, and guidance to help them refine their business ideas, develop their products or services, and build a strong foundation for success.\r\n\r\nDuring a startup bootcamp, participants typically go through a rigorous and immersive experience that includes workshops, training sessions, one-on-one mentorship, and networking opportunities. The program covers various aspects of starting and scaling a business, such as market research, product development, marketing and sales strategies, financial planning, and investor pitching.\r\n\r\nThe bootcamp environment fosters collaboration and peer-to-peer learning, allowing founders to connect with like-minded entrepreneurs, share insights, and build a supportive network. Experienced mentors and industry experts provide valuable advice, guidance, and feedback to help participants navigate challenges, refine their business models, and make informed decisions.\r\n\r\nIn addition to knowledge and mentorship, startup bootcamps often offer access to resources such as co-working spaces, funding opportunities, investor connections, and potential partnerships. They create an ecosystem that nurtures innovation and provides a platform for startups to gain visibility, attract investment, and accelerate their growth trajectory.\r\n\r\nThe duration of a startup bootcamp can vary, ranging from a few weeks to several months. The ultimate goal is to equip entrepreneurs with the skills, knowledge, and networks they need to build successful and sustainable businesses. By participating in a startup bootcamp, founders can gain valuable insights, overcome challenges more effectively, and increase their chances of long-term success in the competitive startup landscape.','1687211157_Start-Up-web-1-scaled.jpg','Active','2023-06-19 09:45:57',1,'2023-06-20 03:52:41',34),
(18,'Stem Camp','2023-06-22','STEM Camp is an engaging and educational program designed to introduce young learners to the fields of science, technology, engineering, and mathematics (STEM). It provides a fun and interactive environment where participants can explore and develop their skills in these disciplines through hands-on activities, experiments, and projects.\r\n\r\nDuring a STEM Camp, students have the opportunity to dive into various STEM subjects, such as robotics, coding, physics, chemistry, biology, and mathematics. They engage in exciting experiments, solve problems, and work on collaborative projects that promote critical thinking, problem-solving, creativity, and teamwork.\r\n\r\nThe camp curriculum is carefully designed to align with age-appropriate content, allowing participants to progressively build their knowledge and skills throughout the program. Experienced instructors and educators guide the students, providing them with the necessary support and mentorship to explore STEM concepts in a safe and encouraging environment.','1687211647_2nd-Winter-Stem-Camp-JNEC-web-scaled.jpg','Active','2023-06-19 09:54:07',1,NULL,NULL),
(19,'Workshop','2023-06-23','A workshop is an interactive and practical learning experience that focuses on a specific topic or skill. It is designed to provide participants with hands-on training, knowledge, and practical tools that they can immediately apply in their personal or professional lives.\r\n\r\nDuring a workshop, participants engage in various activities, exercises, and discussions to actively learn and practice the subject matter. Workshops are often facilitated by subject matter experts or experienced trainers who guide the participants through the learning process, answer questions, and provide valuable insights and feedback.\r\n\r\nThe content of a workshop can vary widely depending on the topic and objectives. Workshops can cover a range of subjects, including leadership development, communication skills, problem-solving techniques, team building, time management, stress management, creativity, and many more.\r\n\r\nWorkshops typically have a structured agenda and may include presentations, group activities, case studies, role-playing, brainstorming sessions, and practical exercises. Participants are encouraged to actively participate, share their experiences, collaborate with others, and apply the newly acquired knowledge and skills in real-life scenarios.','1687211749_IMG_6949-1.jpg','Active','2023-06-19 09:55:49',1,NULL,NULL),
(20,'Training','2023-06-22','Training is a structured learning program designed to develop and enhance specific skills, knowledge, and competencies in individuals or groups. It involves the systematic delivery of information, instruction, and practical exercises to facilitate learning and enable participants to acquire new abilities and improve their performance in a particular area.\r\n\r\nDuring a training program, participants engage in various activities and exercises tailored to the specific learning objectives. The content of the training can cover a wide range of topics, including technical skills, professional development, leadership, sales and marketing techniques, customer service, software proficiency, safety procedures, and more.\r\n\r\nTrainers, subject matter experts, or experienced facilitators lead the training sessions. They provide guidance, instruction, and feedback to help participants understand and apply the concepts being taught. Training methods may include lectures, presentations, demonstrations, case studies, simulations, hands-on practice, group discussions, and assessments.\r\n\r\nThe duration of a training program can vary depending on the complexity of the subject matter and the desired learning outcomes. It can range from a few hours to several days or even weeks, depending on the depth of knowledge and level of skill development required.\r\n\r\nThe goals of a training program typically include improving job performance, enhancing specific skills, fostering professional growth, promoting employee engagement, and supporting organizational objectives. Training programs aim to bridge knowledge gaps, address specific needs, and provide individuals with the tools and knowledge necessary to excel in their roles.','1687211880_Basic-IT-Course.gif','Active','2023-06-19 09:58:00',1,NULL,NULL);
insert  into `t_facilities`(`id`,`name`,`photo`,`details`,`created_at`,`created_by`,`updated_at`,`updated_by`) values 
(32,'Workspace','1687215679_20230619_143424.jpg,1687215679_20230619_143428.jpg','Physical Layout: Working spaces can be designed in various layouts, such as open-plan spaces, cubicles, private offices, or a combination of these. The layout is determined by factors like the nature of work, the desired level of interaction, and privacy requirements.\r\n\r\nWorkstations: Workstations in a working space typically consist of desks, chairs, and storage units. They provide individuals with a designated area to set up their equipment, documents, and personal belongings.\r\n\r\nMeeting and Collaboration Areas: Many working spaces include designated areas for meetings, discussions, and collaborative work. These areas may feature meeting rooms with audiovisual equipment, whiteboards, and comfortable seating arrangements to facilitate effective communication and teamwork.\r\n\r\nAmenities and Facilities: Depending on the working space, there may be various amenities and facilities available to enhance productivity and well-being. These can include high-speed internet connectivity, printers, scanners, shared kitchen or break areas, recreational spaces, and access to refreshments.\r\n\r\nAccessibility and Infrastructure: Working spaces are often designed with considerations for accessibility, providing features such as ramps, elevators, and appropriate restroom facilities. They also offer basic infrastructure requirements like power outlets, lighting, and ventilation to ensure a comfortable working environment.\r\n\r\nNetworking Opportunities: Working spaces can foster a sense of community and provide networking opportunities. Shared spaces and coworking environments enable professionals from different backgrounds and industries to interact, share ideas, and potentially collaborate on projects.','2023-06-19 11:01:19',34,NULL,NULL),
(33,'Computers','1687215741_20230619_143232.jpg','Central Processing Unit (CPU): The CPU is often referred to as the \"brain\" of the computer. It performs most of the actual data processing and executes instructions stored in the computer\'s memory. The CPU consists of an arithmetic logic unit (ALU) for performing calculations and a control unit for coordinating operations.\r\n\r\nMemory: Computers have two main types of memory. Random Access Memory (RAM) provides temporary storage for data and instructions that are actively being used by the CPU. Read-Only Memory (ROM) stores permanent instructions, such as the computer\'s firmware or BIOS.\r\n\r\nStorage Devices: Computers have various types of storage devices for long-term data storage. Hard Disk Drives (HDDs) and Solid State Drives (SSDs) are commonly used to store operating systems, software programs, and user data. Optical drives, such as CD/DVD drives, can read and write data on optical discs.','2023-06-19 11:02:21',34,NULL,NULL);
