(6,'Bishal','dhakalbishal930@gmail.com',17959259,'First and foremost, I would like to express my appreciation for [specific positive aspects or features]. [Describe what impressed you or what you found particularly valuable]. It has certainly made a positive impact on my [work/personal life] by [benefits or improvements experienced].\r\n\r\nMoreover, I would like to highlight [any additional positive aspects or strengths] that have contributed to my overall satisfaction. [Provide specific examples or instances where you felt impressed or satisfied]. This demonstrates the commitment to quality and excellence that your [company/organization/individual] strives for.\r\n\r\nHowever, I would also like to bring to your attention some areas that could be improved upon. [Constructive feedback or suggestions]. While I understand that perfection is not always attainable, addressing these points may further enhance the overall [product/service/experience] and elevate it to even greater heights.','2023-06-19 11:12:03',NULL,NULL,NULL);
insert  into `t_home_content`(`id`,`title`,`content`,`created_at`,`created_by`,`updated_at`,`updated_by`,`link`) values 
(1,'JNEC- ENTREPRENEURSHIP AND INNOVATION CENTRE','The JNEC Entrepreneurship and Innovation Centre is set up to provide business support & technology transfer initiative for various sectors in the multidisciplinary areas of science, technology, and humanities in the region. The establishment of the centre is supported by the Department of Employment and Entrepreneurship under the Ministry of Labor and Human Resources through Start-up/CSI Flagship program in 2020.\r\n\r\nThe main aim is to produce successful firms that will leave the programme financially viable and independent, through Science and Technology interventions. In particular, the purpose of the JNEC-Entrepreneurship and Innovation Centre is to incubate and materialize the conceptual ideas among the students, faculty members of Jigme Namgyel Engineering College, and other relevant institutions/firms and transform these ideas into value-added products in the commercial market.\r\n\r\nJNEC-Entrepreneurship and Innovation will nurture budding ventures by providing workspace and shared facilities along with focused counseling. In the centre, the entrepreneurs can receive value-added support and access to critical tools, information, education, networking, resources, and prototype fund in the form of research and development that may otherwise have been unaffordable.',NULL,NULL,'2023-06-19 06:53:42',1,'https://www.youtube.com/embed/h7Bjt5ytnKg?autoplay=1');
insert  into `t_incubates`(`id`,`photo`,`description`,`name`,`created_by`,`created_at`,`updated_by`,`updated_at`) values 
(6,'1687214760_360_F_251554631_FLQCoeVFXWjSr32bCSC3cK75JSy3CiSI.jpg','Incubates, in the context of entrepreneurship and business, refer to individuals or early-stage startups that are part of an incubator program. An incubator is an organization or program that provides resources, support, and mentorship to help nurture and grow startup companies.','Bishal',34,'2023-06-19 10:46:00',NULL,NULL),
(7,'1687214796_360_F_251554631_FLQCoeVFXWjSr32bCSC3cK75JSy3CiSI.jpg','Incubators can be sector-specific, focusing on particular industries such as technology, healthcare, or social entrepreneurship, or they can be generalist, supporting startups from diverse sectors. The duration of incubation programs varies, but they typically last for a fixed period, often ranging from a few months to a couple of years.','Sangay',34,'2023-06-19 10:46:36',NULL,NULL);
